import React from "react";
import tankenImage from "../images/tanken.png";


function Projetos(){
    return(
        <section id="projetos">
            <h2>PROJETOS</h2>
            <div class="project-img-wrapper">
                <img src={tankenImage}></img>
            </div>
            <div class="project-content">
                
            </div>
        </section>
    )
}

export default Projetos
